import React from "react";
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";
import VDayQuestion from "./components/VDayQuestion";
import Yipie from "./components/Yipie";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={VDayQuestion} />
        <Route path="/yipie" component={Yipie} />
      </Switch>
    </Router>
  );
  }
export default App;
